@dylanberry Thanks for reaching out.
We've passed along your suggestion to our catering team.
We told them you said, "Cheese, please!"

@eweezy__ Our apologies for the frustration you’re feeling.
If you need our help, please send us a direct message with your request, your full name, reservation code and where you're booked to fly from and to.
Or you can see an agent at the airport check-in counter or at the gate. https://t.co/o7MlHGd5Wh

@cbcraneoo88 We're not sure what you're asking.
If you need our help, please send us a direct message with your request, your full name, reservation code and where you flew from and to.
Our system wouldn't know who's an ex-NHL star or the spouse of one. https://t.co/o7MlHGd5Wh

@mishfishpark Our apologies for the interruption to your travel plans.
If you need our help, please send us a direct message with your request, your full name, reservation code and where you flew from and to.
If you have checked baggage, please see an agent at the airport. https://t.co/o7MlHGd5Wh

@jo_kandi_cain To report a delayed bag, please click here: https://t.co/gGTmIVwMOl.
Select the “CREATE A REPORT” button.
On the next screen, choose “CREATE A DELAYED BAG.”

@TurnerJG WS3423 was cancelled due to unscheduled maintenance, which is required for safety.
Unfortunately, we aren't able to plan for unscheduled maintenance.
If you need our help, send us a DM. https://t.co/o7MlHFVuxH

